import React from "react";

function Nav() {
  return (
    <div className="nav">
      <div className="contents">
        <img src="https://uploads-ssl.webflow.com/602157ad10cc4531453de902/602157ad10cc45079b3de94e_netflix-logo-5-p-800.png"></img>

      </div>

    </div>
  );
}

export default Nav;
